import React from 'react';
import AppRouter from './routing/AppRouter';
import MenuContainer from './routing/menu';

const App: React.FC = () => {
  return (
    <React.Fragment>
      <MenuContainer></MenuContainer>
      <AppRouter></AppRouter>
    </React.Fragment>
  );
}

export default App;
